import React, { useState, useEffect } from 'react';
import { useAuth } from '../contexts/AuthContext';
import { authAPI } from '../services/api';

const Dashboard = () => {
  const { user } = useAuth();
  const [profile, setProfile] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const response = await authAPI.getProfile();
        setProfile(response.data);
      } catch (err) {
        setError('Failed to load profile');
        console.error('Profile fetch error:', err);
      } finally {
        setLoading(false);
      }
    };

    if (user) {
      fetchProfile();
    }
  }, [user]);

  if (loading) {
    return (
      <div className="dashboard-minimal">
        <div className="dashboard-container">
          <div className="dashboard-header">
            <h1>VoiceAI Dashboard</h1>
            <p>Loading your profile...</p>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="dashboard-minimal">
      <div className="dashboard-container">
        {/* Header */}
        <header className="dashboard-header">
          <h1>VoiceAI Dashboard</h1>
          <p>Manage your voice AI assistant</p>
        </header>

        {/* Main Content */}
        <main className="dashboard-main">
          {error && (
            <div className="error-banner">
              <p>{error}</p>
            </div>
          )}

          {/* Welcome Section */}
          <section className="welcome-section">
            <h2>Welcome back, {user?.first_name || 'User'}!</h2>
            <p>Your voice AI assistant is ready to help with your business calls and appointments.</p>
          </section>

          {/* Stats Section */}
          <section className="stats-section">
            <div className="stat-card">
              <h3>📞 Total Calls</h3>
              <p className="stat-number">0</p>
              <p className="stat-label">This month</p>
            </div>
            <div className="stat-card">
              <h3>📅 Appointments</h3>
              <p className="stat-number">0</p>
              <p className="stat-label">Scheduled</p>
            </div>
            <div className="stat-card">
              <h3>⏱️ Uptime</h3>
              <p className="stat-number">24/7</p>
              <p className="stat-label">Always available</p>
            </div>
          </section>

          {/* Features Section */}
          <section className="features-section">
            <h2>Quick Actions</h2>
            <div className="action-grid">
              <div className="action-card">
                <h3>🎙️ Voice Settings</h3>
                <p>Configure your AI assistant's voice and responses</p>
                <button className="action-btn">Configure</button>
              </div>
              <div className="action-card">
                <h3>📋 Call History</h3>
                <p>Review past conversations and interactions</p>
                <button className="action-btn">View History</button>
              </div>
              <div className="action-card">
                <h3>📊 Analytics</h3>
                <p>Track performance and usage statistics</p>
                <button className="action-btn">View Reports</button>
              </div>
              <div className="action-card">
                <h3>⚙️ Account</h3>
                <p>Manage your account settings and preferences</p>
                <button className="action-btn">Settings</button>
              </div>
            </div>
          </section>

          {/* Status Section */}
          <section className="status-section">
            <h2>System Status</h2>
            <div className="status-list">
              <div className="status-item">
                <span className="status-indicator online"></span>
                <span>Backend Connection</span>
                <span className="status-text">Connected</span>
              </div>
              <div className="status-item">
                <span className="status-indicator online"></span>
                <span>Authentication</span>
                <span className="status-text">Active</span>
              </div>
              <div className="status-item">
                <span className="status-indicator online"></span>
                <span>Voice AI Service</span>
                <span className="status-text">Ready</span>
              </div>
            </div>
          </section>
        </main>
      </div>
    </div>
  );
};

export default Dashboard;
